CREATE TABLE `ideas` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `idea_name` varchar(120) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `idea_description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `idea_details` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `created_by` int(10) unsigned NOT NULL,
  `customer_idea` tinyint(1) DEFAULT '0',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `ideas_created_by` (`created_by`),
  KEY `ideas_created_at` (`created_at`),
  CONSTRAINT `ideas_users_fk` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
